import React from "react";
import {NavBlock, NavItem} from "./styles";

const navItem = [
    {
        mainMenu: "아이템1",
        subMenu: [
            {
                name: "상품1",
                path: "#"
            },
            {
                name: "상품1",
                path: "#"
            }]
    },
    {
        mainMenu: "아이템2",
        subMenu: [
            {
                name: "상품1",
                path: "#"
            },
            {
                name: "상품1",
                path: "#"
            }]
    }
];

const Nav = () => {
    return (
        <NavBlock>
            {navItem.map(item => (
                <NavItem>{item.name}</NavItem>
            ))}
        </NavBlock>
    )
};
export default Nav
